VALUES ('51c67a8a-0623-4540-8cfe-74be18f491be', '2023-05-12', 'Экологичный аукцион', 'Зелёнка', '', 'Приглашаем всех принять участие в благотворительном онлайн-аукционе, все вырученные средства от которого пойдут на поддержку работы «Зелёнки». На нём вы сможете выставить свои вещи (одежда, книги, украшения, предметы интерьера и т.д), участники аукциона будут предлагать свои цены. Участник, предложивший наибольшую цену, должен будет сделать на эту сумму пожертвование в пользу «Зеленки», чтобы забрать понравившуюся вещь.

С 15 по 22 февраля присылайте в личные сообщения сообщества фотографии (одна вещь или комплект - одно фото) и краткое описание того, что вы хотите выставить на аукцион.
С 23 по 25 февраля эти фотографии будут загружены в специальный альбом, где и развернётся аукцион.

Стартовая цена каждой вещи будет 100 руб. А дальше желающие будут повышать стоимость с шагом в 50 руб.

Отдельно хотим пригласить мастеров, которые делают вещи своими руками. Если вы выставите новую вещь, то стартовую цену назначите сами, и сможете так себя дополнительно прорекламировать.

С нетерпением ждём ваши фотографии!',
