       ('c4cff011-7749-48af-829c-27b9615c4cac', '2023-03-29', 'Рефил-карта', 'Твоя вода', '', 'Когда хочется пить, при этом совсем не хочется загрязнять планету одноразовым пластиком, то на помощь экологичным потребителям приходит Проект «Твоя Вода». Они помогают найти места в городе, где можно наполнить заново свою бутылочку питьевой водой бесплатно!

🌀 На рефил-карте «Твоя Вода» собраны 1500+ партнеров  @refill_water_bottle_bot – отправив боту свою геолокацию, в ответ он пришлет адреса трёх ближайших заведений (в дополнение к адресам бот поможет построить маршрут к точке, расскажет, как наполнить заново)

🌀 В фонтанчиках от REFILL можно бесплатно наполнить свою бутылочку водой, а также за свой эковклад, свой рефил, автоматически получить бонусы на карту ВкусВилл.

Если вашего любимого заведения нет на рефил-карте, помогите рефил-карте расти: расскажите персоналу о проекте и предложите присоединиться 💧',
