       ('cffbd916-aa22-4d5f-8caf-05960b1483f1', '2023-06-14', 'Книжный маркет', 'Фонарик', '', '«Фонарь» — это книжная гаражная распродажа, прибыль от которой отправляют на благотворительность.
Мы не могли не откликнуться на просьбу о поддержке благотворительного проекта «Простые вещи»: ребята создают пространство для транзитного трудоустройства «Теплица». Оно будет помогать освоить профессии и потом найти работу людям с ограниченными возможностями здоровья.
Прошлым летом «Фонарь» был в Нормальном месте и было здорово. В этот раз в кафе «Огурцы» пройдёт «Фонарик», и, чтобы всё получилось, нужна ваша помощь.
А точнее — книги!
Приносите свои книги в хорошем состоянии. Изданные за последние 20 лет: художественная литература для детей и взрослых, нон-фикшн, прикладная литература. Мы рассчитываем, что вы принесёте хорошие, интересные книги, которые кто-то захочет купить — так на распродаже каждый сможет найти что-то для себя 💛
Книги можно приносить уже сейчас и до 21 числа в Ангар на Большую Монетную, 24 АБ. А сам «Фонарик» пройдёт 22 апреля с 12:00 до 21:00.
Приносите книги и расскажите друзьям о «Фонарике»!
